// This is a layout design for all pages to have same theme/design
import React from 'react';
import Container from 'react-bootstrap/Container';
import withRouter from 'react-router-dom/withRouter';
// Container obj from Bootstrap automatically configures borders of given props

const Layout = (props) => {
    console.log(this.props.location.pathname);
    return (
        <Container>
            {props.children}
        </Container>
    )
}

export default withRouter(Layout);
